import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import MacOS from "./pages/MacOS";

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
        <Route path="/" element={<MacOS />} />
          <Route path="*" element={<div>Page Not Found</div>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
